import './App.css';
import React, {useEffect} from 'react';
import axios from 'axios';

function App() {
  useEffect(()=>{

    fetch("http://localhost:4000/")
    .then(res=res.json())
    .then(res=>{
      console.log(res);
    })

  },[])

  return (
    <></>
  );
}

export default App;
